import React, { ReactElement } from 'react';

import { Image } from 'antd';
import 'antd/dist/antd.css';

import s from './AvatarUserProfile.module.sass';

import { UserStatus } from 'components';
import { Nullable } from 'types';

type AvatarUserProfileType = {
  photosLarge: Nullable<string>;
  status: string;
  fullName: Nullable<string>;
};

export const AvatarUserProfile = ({
  status,
  fullName,
  photosLarge,
}: AvatarUserProfileType): ReactElement => {
  const imgUrl = photosLarge || 'error';

  return (
    <div className={s.avatarWrapper}>
      <div className={s.avatarImg}>
        <Image
          width={200}
          height={200}
          src={imgUrl}
          fallback="data:image/jpeg;base64,"
        />
      </div>
      <h2 className={s.name}>{fullName}</h2>
      {status && <UserStatus status={status} />}
    </div>
  );
};
